(123, 36, 'Upcoming Training and Placement Activities for 2019 batch:', 'Dear Students,\r\n\r\nWelcome to the Training and Placement activities!\r\n\r\nAssessment 1 - 14/08/2018 - HireMee online assessment through mobile in college - All Branches - No Cut Off. All the aptitude modules will be there, you will also have to upload a video Resume after the test. Based on score and video resume, you will be shortlisted directly for the final round of multiple companies\r\n\r\nAssessment 2 - 22/08/2018 - First Naukri - Online Test in college labs - All Branches - No Cut Off. Shortlisted students will be considered for multiple companies. All branches core companies will be there. Major companies include:\r\nÂ· ZS Associates: INR 5 to 6 Lacs\r\nÂ· Schlumberger: INR 5 to 15 Lacs\r\nÂ· TIBCO Software India Pvt. Ltd.: INR 5.5 Lacs\r\nÂ· Directi Internet Solutions Pvt. Ltd.: INR 25 to 27 Lacs\r\nÂ· Jaro Education: INR 3.5 to 7 Lacs\r\nÂ· Minda Management Services Ltd.: INR 7LPA\r\nÂ· GreyOrange india pvt ltd: INR 14LPA\r\nÂ· Yamaha Motor Company Limited: INR 5LPA\r\nÂ· Hitachi, Ltd. : INR 5LPA\r\nÂ· Envestnet Yodlee : INR 6 to 10 LPA\r\nÂ· ITC Limited : INR 7.5 LPA\r\nÂ· S&P Global Inc.: INR 5 LPA\r\nÂ· Rockwell Automation, Inc: INR 5 to 6.5LPA\r\nÂ· Enphase Energy: INR 7 to 7.5 LPA\r\nÂ· ADP Pvt Limited: INR 5 LPA\r\nÂ· Eurofins IT Solutions: INR 6.5 LPA\r\nÂ· UTC Aerospace: 6 to 6.5 LPA\r\nÂ· CUSMAT Technologies: 6 to 12 LPA\r\n\r\n* TCS Recruitment through TCS Ninja - Registrations will start on 10/08/2018 and end on 17th of August. Mock Test link will be shared once the registrations start. The actual test will be in the first week of September tentatively. \r\n\r\n* An MNC Campus Drive for CSE / ISE / ECE / EEE. The test pattern will be Round 1 - QA, LR, Essay Writing. - may be 1 hour test. Essay - 300 words;  Upon getting shortlisted, Round 2 - Pseudocode round - majorly error finding or output finding; Round 3 - Technical Interview - Basic technical concepts of your branch; Round 4 - HR Interview', 1, 2019, '', 0, '2018-08-03 05:31:42'),
