(25, 90, 'SAMEEKSHA-An obstacle avoidance security robot', 'Jyothy Institute of Technology', '16/01/2017', '25/05/2017', '             The project is designed to build an obstacle detection and avoidance robotic vehicle using ultrasonic sensor for obstacle detection. A driver controller is used for achieving the purpose of design.\r\n              A robot is a machine that can perform task automatically or with guidance. Robotics      is a combination of computational intelligence and physical machines. Computational intelligence involves the programmed instructions.  \r\n             The project proposes robotic vehicle that has an intelligence built in it such that it redirects itself whenever an obstacle comes in its path. An Ultrasonic sensor is used detect the obstacle that comes in its path and sends a command to the driver controller. Depending on the input signal received, the micro-controller redirects the robot to move in an alternate direction by actuating the motors. There are two ways to control this Robot.  They are Manual control and the Automatic control. When the user chooses the manual control', '4', 'Embbeded C, Python', 'C, Python, Arduino UNO, Device driver, Bluetooth module', '2017-05-16 14:25:00'),
