(43, 80, 'Sameeksha- An Inspecting Security Robot ', '', '25/01/2017', '22/05/2017', 'The project is designed to build an obstacle detection and avoidance robotic vehicle using Ultrasonic sensor for obstacle detection. A driver controller is used for achieving the purpose of design.\r\nThe project proposes robotic vehicle that has an intelligence built in it such that it redirects itself whenever an obstacle comes in its path. An ultrasonic sensor is used to detect the obstacle that comes in its path and sends a command to the driver controller. Depending on the input signal received, the micro controller redirects the robot to move in an alternate direction by actuating the motors. There are two ways to control this Robot. They are Manual control and Automatic control. When the user chooses the manual control, the robotic vehicle switches to user control mode where the user can control the movement of the robot using Mobile application. When the user chooses the automatic control, the Robot switches to self-monitoring mode.', '4', 'Arduino IDE, Embedded C, Python, Noobs Operating system ', 'Arduino UNO R3, Ultrasonic sensor, Bluetooth Module, Camera Module, Servo motor, Raspberry Pi2, Flame Senor, Gas Detection Sensor ', '2017-05-19 07:07:46'),
