(185, 924, 'N-queen problem ', 'ACS college of engineering', '01/03/2018', '24/05/2018', 'The N Queen is the problem of placing N chess queens on an NÃ—N chessboard so that no two queens attack each other. The idea is to place queens one by one in different columns, starting from the leftmost column. When we place a queen in a column, we check for clashes with already placed queens. In the current column, if we find a row for which there is no clash, we mark this row and column as part of the solution. If we do not find such a row due to clashes then we backtrack and return false.\r\n\r\n\r\n\r\n', '2', 'OpenGL,C++', 'GLUT(graphics library utility tool kit), Microsoft visual studio code', '2018-07-25 15:49:18'),
(188, 895, 'DBMS project on Airline Reservation System', '', '07/07/2018', '25/07/2018', 'Developed a web based mini project on airline reservation in which we can reserve airline tickets ,view flight details,current status,insert  ,delete and retrieve  data.This project basically deals with basic concepts of database', '2', '', 'Glass fish server  netbeans andmy sql database', '2018-07-25 15:52:03'),
