(331, 925, 'Library management system ', 'Rajarajeshwari College Of Engineering ', '09/08/2017', '11/09/2017', 'Library management system is a project which aims at developing a computerized system to maintain all the daily work of library. It is designed using java as front end and SQLite as back end. The transaction like login, new account, add, search, delete, issue and more features are provided. It stores the details like username, password, security questions, user id, book name, book Id, author, publisher, price which belongs to the particular book. ', '3', 'SQLite, java', 'Laptop', '2018-09-03 10:38:43'),
(332, 925, 'LPG Detection and booking using GSM Module and Microcontroller ', 'Rajarajeshwari College Of Engineering ', '05/12/2017', '07/01/2018', 'In LPG gas Detection of leakage gas is done by gas sensor which is interfaced with arm.When gas is detected, we inform the user about the gas leakage by turning on the buzzer and also message displaying on Lcd. Here we continously measure the amount of gas which is present in the cylinder. When gas level goes below the set level the message will be sent to the gas agency through gsm and confirmation message is received by the user from the gas agency. So the user gets the cylinder within time. ', '4', 'Coding', 'Microcontroller, gas sensor, digital display, electric wires, buzzer', '2018-09-03 10:54:39'),
