(391, 1778, 'Garbage monitoring system', 'Logimware softtec pvt.ltd', '08/07/2018', '04/08/2018', 'It is automatic garbage level detector .Corporation autority can easily get message through gsm and the location through gps .so that they can dump the waste easily and save time .Here ir sensor is used to maintain the hygienic so that if person is sensed so only the cap of garbage get opens and the level of garbage can be seen by using iot.', '4', '', 'Microcontroller kit,gsm, gps, iot,ir sensor', '2018-09-08 14:08:13'),
(392, 896, 'Airline Reservation System', '', '01/09/2016', '25/11/2016', 'Airline reservation System is a computerized system used to store and retrieve information and conduct transactions related to air travel. The project is aimed at exposing the relevance and importance of Airline Reservation Systems. It is projected towards enhancing the relationship between customers and airline agencies through the use of ARS, and thereby making it convenient for the customers to book the flights as when they require such that they can utilize this software to make reservations.This software has two parts. First is user part and the administrator part. User part is used as a front end and administrator is the back end. Administrator is used by airline authority. It will allow the customers to access database and allow new customers to sign up for online access. \r\nImage of page 2\r\n', '2', '', 'net beans,windows 7 OS,SQL,JAVA', '2018-09-12 05:56:31'),
(393, 896, 'Selective Repeat ARQ', '', '01/03/2018', '25/05/2018', 'Selective Repeat is part of the automatic repeat-request (ARQ). With selective repeat, the sender sends a number of frames specified by a window size even without the need to wait for individual ACK from the receiver as in Go-Back-N ARQ. The receiver may selectively reject a single frame, which may be retransmitted alone; this contrasts with other forms of ARQ, which must send every frame from that point again. The receiver accepts out-of-order frames and buffers them. The sender individually re transmits frames that have timed out.', '2', '', 'Microsoft Visual studio, windows 10 OS,C language', '2018-09-12 05:55:37'),
(394, 1391, 'automatic tunnel lighting system', 'S M Polytechnic sagara', '27/08/2013', '12/05/2014', 'The main purpose of this project to save the electrical energy in tunnel avoid the accidents inside the tunnel and survey the number of vehicles inside temperature monitoring in tunnel. ', '6', 'soldering,  hardware design, coding', 'keil microvision version 3', '2018-09-17 16:23:46'),
