(877, 'student', 'active', 'D', 'STU_REG_4457536840', 14, 'ACS College Of Engineering ', 'BHAVYA PS', 'profile_img/877-Bhavya.jpg', 'psbhavyashree@rocketmail.com', '', 'dcd0fcc977a61394e9fd8d239d5fcfd8', 'longlyf9', '1AH15CS012', '9632525173', 'female', 'India', 'Karnataka', 'banglore', 'resume_uploads/STU_RESUME_856538_Bhavya Resume.docx', 'yes', 'I am good at coding,testing and development. I would like to create a good relationship in environment.i usually have the habit of reading newspapers and journals to know about the world trends and the technologies used in developing a product,I am very keen in learning new coding languages and interested to work on it.', 'Bhavya PS\r\n#43,13th main,MC Layout,vijayanagar,\r\nBengaluru, 560040.\r\nContact no-9632525173\r\npsbhavyashree@rocketmail.com\r\nHi Sir,\r\n\r\nThis letter is to express my interest in your company to work as a Software Developer. \r\nI am currently studying in 4th year ,Bachelorâ€™s degree in Computer Science. I am confident I will be an asset to your organization.\r\n\r\nI enjoy being challenged and engaging with projects that require me to work outside my comfort and knowledge set, as continuing to learn new languages and development techniques are important to me and the success of your organization.\r\n\r\nThe skills that i possess are :\r\nHighly skilled in designing, testing, and developing software thorough understanding of data structures and algorithms,Knowledgeable of back-end development best practices in phyton,cloud computing,java and J2ee.\r\n\r\nThank you for your time and consideration. I look forward to this opportunity.\r\n\r\nSincerely,\r\n\r\nBhavya PS', '09/10/1997', 'Panner Selvam a', 'Amudhavalli N', '#43,13th main,MC Layout,Vijayanagar,Bengaluru -560040', '8884109772', '2018-07-25 15:16:28'),
